03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1658032","type":"CustomJS"},{"attributes":{"data":{"equity_dd":{"__ndarray__":"AAAAAAAA8D8AAAAAAADwPwTy4L7l/+8/xKi8Rzlb7z/QIkpSYBHvP3NOoiF9Yu8/ehR6EhdX7z9IMy4xqdXuP5po7mjice4/T4u3qku47j/1EZRYwP/uP7bWcoA4Eu8/aamN82Ii7z80ULgxiivvPzvAz9wWsu4/3c4pKdbf7z9PO1fQy8DvP8GwIXa8OvA/mnsncutG8D9/Dslb43vwP2b2sjItg/A/F+qFxCSV8D/MKGrZf3/wPylDSmN6kfA/9An3piyx8D8N9vAD/2fwPyEmLaVJdfA//aP5bdxf8D/Yq7lheFfwPwrbqRtwavA/S2McKQAy8D+gfEeRsxzwP9VeRjsJPfA/BccUq2Ig8D/VqUxqUSLwPxYu00n8Q/A/P3/m9XQZ8D9P3YfrYRvwP7nqOW4EKvA/b5lJhREC8D/Uvb/hWg/wPys5pvCWDvA/ld7AOhvI7z/CKyjs3RvwP5IYBuamSPA/ddEiuMpC8D+wSwegc2XwP+m25lfocfA/e0MN7gbK7j//GdOWpirvPx650tG3gO4/gsX6ATHM7T8aLS2KajPtPx4USGMRmOw/qVRa2ssS7T8NyVIYie/sP5NZSsHq2+w/P9ZMGhTi7D+Zh+O3QjTsP2EwSOoF2Os/8GBCkk6d6z9osCCNEY/rPwxnPYd53Os/IpAbTlO26z/Bibl6xrDrPyz7MbZY7us/J+qk4xe66z/rKYOUOoLrP/PR16JgeOs/SSrKjvOI6z8NpzXsXlnrP6JakM7yOes/+7TzgUZR6z9UE6jKaqTrPzmJfIX3vOs/cjy+1KjF6z9EmmkIZd/rPzk73I/Dj+o/fdLO1Ayd6j+Ka022LuzpP1z1pmm0zuk/zSm3+FG76T9UL6ySTxvqP/
